  fullName: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty
  type: Class
  summary: "Representa as propriedades de integração de enfileiramento de mensagens (MSMQ) para uma mensagem."
  remarks: "A classe MsmqIntegrationMessageProperty expõe todas as propriedades de mensagem de enfileiramento de mensagens que podem ser definidas quando você envia uma mensagem ou ler uma mensagem recebida usando o canal de integração.       O <xref:System.ServiceModel.MsmqIntegration.MsmqMessage%601>classe também permite que você defina propriedades de mensagens do enfileiramento de mensagens e é a maneira recomendada para definir propriedades de mensagens do enfileiramento de mensagens.</xref:System.ServiceModel.MsmqIntegration.MsmqMessage%601>       Quando você usar a infraestrutura de canais e mensagens para criar uma mensagem e enviá-lo por um canal de integração, você pode usar a classe MsmqIntegrationMessageProperty como uma propriedade da mensagem para que o canal de integração pode recuperar as propriedades de mensagem e formata a mensagem como uma mensagem do serviço de enfileiramento de mensagens e enviá-lo na conexão."
