- uid: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Id
  id: Id
  parent: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty
  langs:
  - csharp
  name: Id
  nameWithType: MsmqIntegrationMessageProperty.Id
  fullName: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Id
  type: Property
  assemblies:
  - System.ServiceModel
  namespace: System.ServiceModel.MsmqIntegration
  summary: "Obtém o identificador da mensagem."
  remarks: "Serviço de enfileiramento de mensagens (MSMQ) gera um identificador de mensagem quando a mensagem é enviada. O identificador é composto de 20 bytes e inclui dois itens: a máquina GUID do computador de envio e um identificador exclusivo para a mensagem no computador. A combinação dos dois itens produz um identificador de mensagem que é exclusivo na rede.       O Message Queuing gera identificadores de mensagem para todas as mensagens, incluindo mensagens de confirmação e relatório. Geralmente, uma mensagem de confirmação é enviada pelo enfileiramento de mensagens em resposta à chegada ou falha de uma mensagem enviada original."
  syntax:
    content: public string Id { get; }
    return:
      type: System.String
      description: "Identificador da mensagem."
  overload: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Id*
  exceptions: []
  platform:
  - net462
- uid: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Label
  id: Label
  parent: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty
  langs:
  - csharp
  name: Label
  nameWithType: MsmqIntegrationMessageProperty.Label
  fullName: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Label
  type: Property
  assemblies:
  - System.ServiceModel
  namespace: System.ServiceModel.MsmqIntegration
  summary: "Obtém ou define uma cadeia Unicode definido pelo aplicativo que descreve a mensagem."
  remarks: "Você pode usar um rótulo de mensagem para várias finalidades. Por exemplo, você pode usar isso para fins de exibição ou seletivamente processar mensagens com base no valor do rótulo. Não é necessário tornar o rótulo exclusivo entre as mensagens.       Fila de mensagens e mensagem rótulos representam um valor definido pelo aplicativo que pode ajudar a identificam a fila ou a mensagem em termos legível. É responsabilidade do aplicativo para interpretar o conteúdo de rótulo, que não têm nenhum significado intrínseco para enfileiramento de mensagens."
  syntax:
    content: public string Label { get; set; }
    return:
      type: System.String
      description: "Uma aplicativo definido cadeia de caracteres Unicode que descreve a mensagem."
  overload: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Label*
  exceptions: []
  platform:
  - net462
- uid: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.MessageType
  id: MessageType
  parent: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty
  langs:
  - csharp
  name: MessageType
  nameWithType: MsmqIntegrationMessageProperty.MessageType
  fullName: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.MessageType
  type: Property
  assemblies:
  - System.ServiceModel
  namespace: System.ServiceModel.MsmqIntegration
  summary: 'Gets the message type: <xref uid=&quot;langword_csharp_Normal&quot; name=&quot;Normal&quot; href=&quot;&quot;></xref>, <xref uid=&quot;langword_csharp_Acknowledgment&quot; name=&quot;Acknowledgment&quot; href=&quot;&quot;></xref>, or <xref uid=&quot;langword_csharp_Report&quot; name=&quot;Report&quot; href=&quot;&quot;></xref>.'
  remarks: "Normalmente, o enfileiramento de mensagens (MSMQ) define essa propriedade quando ele envia a mensagem. Uma mensagem de enfileiramento de mensagens pode ser um dos seguintes tipos: - Normal, que é uma mensagem típica enviada de um aplicativo para uma fila ou uma mensagem de resposta retornados para o aplicativo de envio.      -Confirmação, enfileiramento de mensagens gerado sempre que o aplicativo de envio solicita um. Por exemplo, enfileiramento de mensagens pode gerar mensagens positivas ou negativas para indicar que a mensagem original chegou ou foi lido. O Message Queuing retorna a mensagem de confirmação apropriada para a fila de administração especificada pelo aplicativo de envio.      -Relatório, que é gerado sempre que uma fila de relatórios está definida na fonte de Gerenciador de fila. Quando o rastreamento estiver habilitado, enfileiramento de mensagens envia uma mensagem de relatório para a fila de enfileiramento de mensagens de relatório sempre que a mensagem original entra ou sai de um servidor de enfileiramento de mensagens."
  syntax:
    content: public Nullable<System.Messaging.MessageType> MessageType { get; }
    return:
      type: System.Nullable{System.Messaging.MessageType}
      description: 'The message type: <xref uid=&quot;langword_csharp_Normal&quot; name=&quot;Normal&quot; href=&quot;&quot;></xref>, <xref uid=&quot;langword_csharp_Acknowledgment&quot; name=&quot;Acknowledgment&quot; href=&quot;&quot;></xref>, or <xref uid=&quot;langword_csharp_Report&quot; name=&quot;Report&quot; href=&quot;&quot;></xref>.'
  overload: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.MessageType*
  exceptions: []
  platform:
  - net462
