- uid: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Priority
  id: Priority
  parent: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty
  langs:
  - csharp
  name: Priority
  nameWithType: MsmqIntegrationMessageProperty.Priority
  fullName: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Priority
  type: Property
  assemblies:
  - System.ServiceModel
  namespace: System.ServiceModel.MsmqIntegration
  summary: "Obtém ou define a prioridade da mensagem, que determina onde colocada a mensagem na fila."
  remarks: "A prioridade afeta como o enfileiramento de mensagens (MSMQ) trata a mensagem enquanto ele estiver em trânsito e depois de atingir o destino. Mensagens de prioridade mais alta são recebem preferência durante o roteamento e inseridas em direção à frente da fila de destino. Mensagens com a mesma prioridade são colocadas na fila de acordo com a hora de chegada."
  syntax:
    content: public Nullable<System.Messaging.MessagePriority> Priority { get; set; }
    return:
      type: System.Nullable{System.Messaging.MessagePriority}
      description: "A prioridade da mensagem. Os valores são definidos por <xref href=&quot;System.Messaging.MessagePriority&quot;> </xref>."
  overload: System.ServiceModel.MsmqIntegration.MsmqIntegrationMessageProperty.Priority*
  exceptions:
